                                            required: true,
                                            message: "请选择是否启用",
                                        },
                                    ],
                                    initialValue: "1",
                                })(
                                    <Radio.Group
                                        onChange={() => this.formChange(7)}
                                    >
                                        <Radio value="1">是</Radio>
                                        <Radio value="0">否</Radio>
                                    </Radio.Group>
                                )}
                            </Form.Item>
                            <Form.Item
                                label={
                                    <label title="撤单间隔阈值">撤单间隔</label>
                                }
                                {...formItemLayout}
                            >
                                {getFieldDecorator("cancelGapSeconds", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请输入",
                                        },
                                        {
                                            message: "请输入正整数",
                                            pattern: /^\d+$/i,
                                        },
                                    ],
                                    initialValue: "0",
                                })(
                                    <Input
                                        placeholder="请输入"
                                        disabled={this.state.disabled7}
                                    />
                                )}
                            </Form.Item>
                        </div>
                        <div>
                            <div
                                className={styles.tit}
                                title="在【时间量(s)】时间内，账户下单频率笔数不能超过【下单频率笔数】,账户下单总量不能超过【下单总量】,账户下单总金额不能超过【下单总金额】,超过上面的任意一个将会拒绝该委托"
                            >
                                <div className={styles.text}>下单频率</div>
                            </div>
                            <Form.Item label="是否启用">
                                {getFieldDecorator("byte8", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请选择是否启用",
                                        },
                                    ],
                                    initialValue: "1",
                                })(
                                    <Radio.Group
                                        onChange={() => this.formChange(8)}
                                    >
                                        <Radio value="1">是</Radio>
                                        <Radio value="0">否</Radio>
                                    </Radio.Group>
                                )}
                            </Form.Item>
                            <Form.Item
                                label={
                                    <label title="下单频率笔数阈值">
                                        下单频率笔数
                                    </label>
                                }
                                {...formItemLayout}
                            >
                                {getFieldDecorator("tradeItemLimit", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请输入",
                                        },
                                        {
                                            message: "请输入正整数",
                                            pattern: /^\d+$/i,
                                        },
                                    ],
                                    initialValue: "0",
                                })(
                                    <Input
                                        placeholder="请输入"
                                        disabled={this.state.disabled8}
                                    />
                                )}
                            </Form.Item>
                            <Form.Item
                                label={
                                    <label title="时间段，建议[1-10]">
                                        时间量
                                    </label>
                                }
                                {...formItemLayout}
                            >
                                {getFieldDecorator("tradeSeconds", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请输入",
                                        },
                                        {
                                            message: "请输入正整数",
                                            pattern: /^\d+$/i,
                                        },
                                    ],
                                    initialValue: "0",
                                })(
                                    <Input
                                        placeholder="请输入"
                                        suffix="秒"
                                        disabled={this.state.disabled8}
                                    />
                                )}
                            </Form.Item>
                            <Form.Item
                                label={
                                    <label title="下单总量笔数阈值">
                                        下单总量
                                    </label>
                                }
                                {...formItemLayout}
                            >
                                {getFieldDecorator("tradeQtyLimit", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请输入",
                                        },
                                        {
                                            message: "请输入正整数",
                                            pattern: /^\d+$/i,
                                        },
                                    ],
                                    initialValue: "0",
                                })(
                                    <Input
                                        placeholder="请输入"
                                        disabled={this.state.disabled8}
                                    />
                                )}
                            </Form.Item>
                            <Form.Item
                                label={
                                    <label title="下单总金额阈值">
                                        下单总金额
                                    </label>
                                }
                                {...formItemLayout}
                            >
                                {getFieldDecorator("tradeAmountLimit", {
                                    rules: [
                                        {
                                            required: true,
                                            message: "请输入",
                                        },
                                        {
                                            message: "请输入正整数",
                                            pattern: /^\d+$/i,
                                        },
                                    ],
                                    initialValue: "0",
                                })(
                                    <Input
                                        placeholder="请输入"
                                        disabled={this.state.disabled8}
                                    />
                                )}
                            </Form.Item>
                        </div>
                    </Form>
                </Modal>
            </div>
        );
    }
}

export default Form.create()(riskConfigManage);
